materials.fragmentShader:
uniform float time;
uniform vec2 resolution;
varying vec2 vUv;

void main()
{
	vec2 p = 4.0*vUv;
	for (int n=1; n<15; n++) {
		float i = float(n);

		p += vec2(
			// Colors get calculated here
			0.6/i*sin(i*p.y+time) + time / 32.0,
			0.8/i*sin(i*p.x+time) + time / 82.3
			);
		}

	// Uncomment this for color limiting
	//p = floor(p);

	gl_FragColor = vec4(
		0.5*sin(p.x)+0.5, // Red
		0.2, // Green
		0.5+sin(p.y)+0.5, // Blue
		1.0);
}

